import React from "react";
import "./Headercrou.css";

function Headercrousalservice() {
  return (
    <div>
      <header>
        <div className="overlay">
          <h1>BRING YOUR BUSINESS ONLINE</h1>
          <p>
            We Make Creativity Work For Your Brand !.... Ours Is A Team Of
            Creatives That Is Brainstorming On Great Ideas, All. The. Time.With
            Our Skills Put Together, You Get An Ensemble Capable Of Doing
            Anything And Everything Your Brand Needs.
          </p>
          <br />
          <button>READ MORE</button>
        </div>
      </header>
    </div>
  );
}

export default Headercrousalservice;
